import React from "react";
import "./App.css";
import Menu from "./Menu.js";
import styled from "styled-components";
import Avatar from '@material-ui/core/Avatar';

const MainContainer = styled.div`
  display: flex;
  flex-direction: column;
  min-height: 100vh;
`;
const StyledDiv1 = styled.div`
  flex: 1;
  background-color: #2D232E;
  display: flex;
`;

const Name = styled.h1`
  color: #ffffff;
  font-size: 4em;
`;
const StyledDiv2 = styled.div`
  flex: 4;
`;

const StyledAvatar = styled(Avatar)`
width: 30em;
`

function App() {
  return (
    <MainContainer>
      <StyledDiv1>
        <Name>Katherine Szelag</Name>
        <Avatar alt="Katherine Szelag" src="https://res.cloudinary.com/dpfixnpii/image/upload/v1583284463/me_ppljqf.png" />
        {/* <img src="https://res.cloudinary.com/dpfixnpii/image/upload/v1583284463/me_ppljqf.png"/> */}
      </StyledDiv1>
      <StyledDiv2>
        <Menu />
      </StyledDiv2>
    </MainContainer>
  );
}

export default App;
